function App() {
  const [data, setData] = useState({});
  const database = firebase.firestore().collection('sections');

  useEffect(() => {
    database
      .get()
      .then(snapshot => {
        snapshot.forEach(i => {
          setData(i.data())
        })
      })
  }, )

